  false,\n\t\"url\": null,\n\t\"notes\": \"Early detection and treatment is crucial
  for successful, cost-effective control of Japanese, giant, and Bohemian knotweed.
  This riparian weed has become a serious problem along several streams/rivers in
  Clark County, and was discovered about 5 years ago in several locations on the Ridgefield
  Complex Refuges along the Columbia River. We have treated them annually where easily
  observed, but not had the time to do an extensive survey of the waterways along
  which this plant could occur. This project will provide a coordinator and volunteers
  to conduct surveys along approximately 17 miles of creek, river and lake shoreline
  to locate, identify location by GPS coordinates, and prepare a report of their findings.\",\n\t\"license_title\":
